export interface IRunMetricChangedEvent {
    RunId: string;
    WorkspaceId: string;
    ExperimentId: string;
    Metrics: Array<{
        MetricType: string;
        MetricName: string;
        MetricId: string;
        CreatedUtc: string;
        Cells: Array<{
            [key: string]: any;
        }>;
        Schema: IMetricSchema;
    }>;
}
export interface IMetricSchema {
    Properties: IMetricSchemaProperty[];
}
export interface IMetricSchemaProperty {
    PropertyId: string;
    Name: string;
    Type: string;
}
